import Demo from "./components/Demo";
import "./App.css";
import "./page/index.js"

function App() {
  return (
    <EthProvider>
      <div id="App" >
        <Login/>
        <div className="container">
          <Demo />
        </div>
      </div>
    </EthProvider>
  );
}

export default App;
